import Navigate from "../Navigate/Navigate";
import "./Header.css";

function Header(): JSX.Element {
    return (
        <div className="Header">
            <div>
                <img src={require('../../../../../../')} alt="hellis-logo" />

            </div>

            <div className="navBar">
                <Navigate />
            </div>
        </div>
    );
}

export default Header;
